tables.table_schema:
CREATE TABLE tokenized_assets (
  asset_id INT PRIMARY KEY,
  token_id INT,
  owner_id INT,
  compliance_status VARCHAR(50)
);

CREATE TABLE tokenized_assets (
    asset_id INT PRIMARY KEY,
    asset_name VARCHAR(255),
    token_owner_id INT
);

CREATE TABLE asset_ownership (
    ownership_id INT PRIMARY KEY,
    asset_id INT,
    owner_id INT,
    ownership_date DATE
);

CREATE TABLE regulations (
    regulation_id INT PRIMARY KEY,
    regulation_name VARCHAR(255),
    regulation_description TEXT
);

CREATE TABLE TokenOwners (
    token_id INT PRIMARY KEY,
    owner_id INT,
    timestamp TIMESTAMP
);

CREATE TABLE Owners (
    owner_id INT PRIMARY KEY,
    owner_name VARCHAR(255)
);

CREATE TABLE Tokens (
    token_id INT PRIMARY KEY,
    token_name VARCHAR(255),
    token_type VARCHAR(50),
    compliance_status BOOLEAN
);
